def read_QMin(path, request):
    QMin = {}
    qminlines = readfile(path)
    natom = int(qminlines[0])

    for r in request:
        for iline, line in enumerate(qminlines):
            if iline <= natom + 2:
                continue
            s = line.split(None, 1)
            if r in s[0]:
                QMin[s[0]] = s[1]
    if 'natom' in request:
        QMin['natom'] = natom
    # pprint.pprint(QMin)
    return QMin

